  \"graphic-preview-description\",\n\t\t\"value\": \"Following the August eruption,
  the inside of Crater Peak was mantled with pryoclastic debris and coarse talus from
  rock avalanches from the steep crater walls. The actual orifice or vent for the
  eruptions is located at the back (NW) corner of the crater, here steaming profusely.
  Other \"rootless\" fumaroles emit steam through the thick blanket of debris on the
  crater rim and where banked against the crater walls.\"\n\t},\n\t{\n\t\t\"key\":
